INSERT INTO `info` VALUES (11,'2014-02-25','PROJETOS','A Funpea vem adotando deste de 2009 política de captação de recursos através da ampliação de parcerias junto às autarquias, instituições de ciência e tecnologia, instituições federais de ensino superior e outras que tem a pesquisa, a extensão e o ensino como elementos imprescindíveis para o desenvolvimento regional.','<h1>\r\n	<span style=\"font-size:11px;\">A Funpea vem adotando deste de 2009 pol&iacute;tica de capta&ccedil;&atilde;o de recursos atrav&eacute;s da amplia&ccedil;&atilde;o de parcerias junto &agrave;s autarquias, institui&ccedil;&otilde;es de ci&ecirc;ncia e tecnologia, institui&ccedil;&otilde;es federais de ensino superior e outras que tem a pesquisa, a extens&atilde;o e o ensino como elementos imprescind&iacute;veis para o desenvolvimento regional.</span></h1>\r\n','','',3,2,214,'S','N'),(13,'2015-01-26','FUNPEA 18 ANOS','A FUNDAÇÃO DE APOIO À PESQUISA, EXTENSÃO E ENSINO EM CIÊNCIAS AGRÁRIAS,está de parabéns. São 18 anos de muita luta, e grandes parcerias. ','<p>\r\n	A FUNDA&Ccedil;&Atilde;O DE APOIO &Agrave; PESQUISA, EXTENS&Atilde;O E ENSINO EM CI&Ecirc;NCIAS AGR&Aacute;RIAS, est&aacute; comemorando 18 anos de exist&ecirc;ncia. Com grandes parcerias que culminam em grande projetos de pesquisas nas mais diversas &aacute;reas do conhecimento. S&atilde;o anos de grandes lutas, mas tamb&eacute;m de grandes vit&oacute;rias. Comemoremos, e fa&ccedil;amos deste a perspectiva de muitos mais anos a frente de inova&ccedil;&otilde;es, parceriais novas, e grandes realiza&ccedil;&otilde;es. Parab&eacute;ns Funpea.</p>\r\n','','',3,2,593,'S','N'),(15,'2015-02-19','Reunião de Parceria','REUNIÃO FUNPEA / RESEX TAPAJÓS ARAPIUNS - 2015\r\n','<p>\r\n	Reuni&atilde;o realizada em janeiro de 2015 para apresenta&ccedil;&atilde;o da FUNPEA e seus projetos j&aacute; executados e em execu&ccedil;&atilde;o, apresentando a credibilidade e confian&ccedil;a no gerenciamento de novos projetos a serem firmados com a Resex Tapaj&oacute;s Arapiuns, localizada em Santar&eacute;m-PA, que tem como esp&eacute;cie amea&ccedil;adas protegida nesta Unidade de Conserva&ccedil;&atilde;o, o Peixe-Boi.</p>\r\n','ASCOM/ FUNPEA','',3,2,607,'S','N'),(16,'2015-02-19','Reunião de Parceria II','Reunião UFOPA/ FUNPEA','<p>\r\n	Reuni&atilde;o realizada em Janeiro/2015 para forma&ccedil;&atilde;o de parceria entre a FUNPEA e a Universidade do Oeste do Par&aacute;. Dessa reuni&atilde;o resultou a assinatura de dois novos projetos a serem gerenciados pela FUNPEA, um deles para atendimento ao PARFOR/ UFOPA e o outro para o Curso para Extens&atilde;o e Aperfei&ccedil;oamento em Gest&atilde;o Cultural/ 2015.</p>\r\n','ASCOM/ FUNPEA','',3,2,608,'S','N'),(17,'2015-03-06','Dia da Mulher 2015','Feliz Dia Internacional da Mulher','<p>\r\n	MULHER<br />\r\n	<br />\r\n	Um aroma suave<br />\r\n	exalou das m&atilde;os do Criador,<br />\r\n	quando seus olhos contemplaram<br />\r\n	a solid&atilde;o do homem no Jardim!<br />\r\n	Foi assim:<br />\r\n	o Senhor desenhou<br />\r\n	o ser gracioso, meigo e forte,<br />\r\n	que Sua imagina&ccedil;&atilde;o perfeita produziu.<br />\r\n	Um novo milagre:<br />\r\n	fez-se carne,<br />\r\n	fez-se bela,<br />\r\n	fez-se amor,<br />\r\n	fez-se na verdade como Ele quer!<br />\r\n	O homem colheu a flor,<br />\r\n	beijou-a, com ternura,<br />\r\n	chamando-a, simplesmente,<br />\r\n	Mulher!</p>\r\n<p>\r\n	Texto retirado do site:&nbsp;http://www.escrita.com.br/escrita/leitura.asp?Texto_ID=821</p>\r\n<p>\r\n	Autora: Ivone Boechat</p>\r\n<p>\r\n	<b style=\"color: rgb(0, 0, 0); font-family: Verdana, Arial; background-color: rgb(255, 247, 234);\">Biografia:&nbsp;</b><br style=\"color: rgb(0, 0, 0); font-family: Verdana, Arial; background-color: rgb(255, 247, 234);\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: Verdana, Arial; background-color: rgb(255, 247, 234);\">Natural do Estado do Rio; Membro da Academia Duquecaxiense de Letras e Artes de Duque de Caxias-RJ; Autora de 16 livros, Consultora em Educa&ccedil;&atilde;o.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n','IVONE BOECHAT','Publicado no livro Amanhecer 3ª edição Reproarte 2004 RJ  ',3,2,609,'S','N'),(18,'2015-03-20','Reunião MPA/ FUNPEA/ UFRA','Reunião com o Ministro de Pesca e Aquicultura, Diretoria Executiva da FUNPEA e o Reitor da UFRA, Sueo Numazawa','<p>\r\n	O Ministro da Pesca e Aquicultura, Helder Barbalho, esteve na Universidade Federal Rural da Amaz&ocirc;nia (UFRA) nesta sexta-feira, 20, para uma reuni&atilde;o com o Reitor da institui&ccedil;&atilde;o, Prof. Sueo Numazawa, e a Diretoria da Funda&ccedil;&atilde;o de Apoio &agrave; Pesquisa, Extens&atilde;o e Ensino em Ci&ecirc;ncias Agr&aacute;rias (FUNPEA), representantes da Superintend&ecirc;ncia Federal do Minist&eacute;rio da Pesca e Aquicultura no Par&aacute;, pesquisadores da UFRA e assessores do Minist&eacute;rio.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	A reuni&atilde;o teve como objetivo a assinatura de dois termos aditivos. Um deles &eacute; relativo a um projeto de constru&ccedil;&atilde;o de um barco de pesquisas e 4 prot&oacute;tipos de embarca&ccedil;&otilde;es para testes, fabricados com fibra e adequados para a pesca de determinadas esp&eacute;cies. O objetivo final &eacute; a renova&ccedil;&atilde;o da frota pesqueira nacional, com embarca&ccedil;&otilde;es tecnologicamente mais avan&ccedil;adas. O outro termo aditivo refere-se a um projeto estruturante para um diagn&oacute;stico da pesca artesanal e da pesca industrial.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	A Universidade coordenar&aacute; um estudo para identifica&ccedil;&atilde;o de todas as estruturas do setor no Par&aacute;, tais como n&uacute;mero de pescadores, n&uacute;mero de barcos e capacidade da Ind&uacute;stria Pesqueira. O estudo, que ser&aacute; feito simultaneamente em todos os estados do Pa&iacute;s, ir&aacute; nortear as pol&iacute;ticas p&uacute;blicas do Minist&eacute;rio da Pesca e Aquicultura para os pr&oacute;ximos anos.</p>\r\n','ASCOM/ FUNPEA','',3,2,656,'S','N');
/*!40000 ALTER TABLE `info` ENABLE KEYS */;
UNLOCK TABLES;

